import React from "react";
import { Bar } from "react-chartjs-2";

export default function Char() {
  return (
    <>
      <Bar
        data={{
          labels: ["a", "b", "c", "d"],
          datasets: [
            {
              label: "My",
              data: [10, 20, 30, 40],
            },
          ],
        }}
      />
    </>
  );
}
